def numSubarraysWithSum(nums: list[int], goal: int) -> int:
  res = 0
  
  left, hm, cp, rn, ps, ln = 0, {}, 1, 0, 0, len(nums)
  
  while rn < ln:
    ps += nums[rn]
    if hm.get(ps, None) is None:
      hm[ps] = rn
      
    if ps >= cp + goal:
      res += sumPrefixZero(left, hm, cp) + sumCurrent(goal) + sumPostfixZero(goal, hm, rn, ps)
      l = hm[cp] + 1
      cp += 1
    
    rn += 1
    
  if ps == goal:
    if hm[cp] is None:
      hm[cp] = ln
    res += sumPrefixZero(left, hm, cp) + sumCurrent(goal) + sumPostfixZero(goal, hm, rn, ps+1)

  return res


def sumPrefixZero(left: int, hm: dict, cp: int) -> int:
  x = hm[cp] - left
  return (x+1) * (x/2)

def sumCurrent(goal: int) -> int:
  if goal == 0:
    return 0
  return 1

def sumPostfixZero(goal: int, hm: dict, rn: int, ps: int) -> int:
  if goal == 0:
    return 0
  x = rn - hm[ps-1] - 1
  return (x+1) * (x/2)

print(numSubarraysWithSum([0,0,0,0,1,0,0], 1))

